                                       <p>From the Add Schedules menu, you can add a new schedule or edit an existing schedule.</p>
                                       <p>To edit a schedule, click the pencil icon next to it. To add a new schedule, click Add a new schedule.</p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/iplschedule1.jpg"></p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/iplschedule2.jpg"></p>
                                       <p>In the Add a new schedule area, complete all required fields, which are noted by a red asterisk. Because more than one schedule can be attached to a class, provide a specific schedule name. The start date should reflect the actual first day that students should be able to view content. Additional fields will appear as selections are made from the drop-down menus.</p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/6 add a new schedule.png"></p>
                                       <p>Select a license from the Select license drop-down menu. Select a schedule type from the Select a schedule type drop-down menu. Select IPL Series.</p>
                                       <p><img alt="" style="width: 300px;" src="../../images/class/7 select schedule type.png"></p>
                                       <p>If a previous IPL schedule was created, that same schedule can be used for multiple classes by selecting it on the Select schedule template drop-down menu.</p>
                                       <p><img alt="" style="width: 700px;" src="../../images/class/iplschedule3.jpg"></p>
                                       <p>From the Units available field, select all units that should be on the class schedule by clicking the arrow to the right of the IPL unit name or by dragging the unit from the Units available field to the Units in your schedule field. Type in the Search field to quickly locate an IPL unit. Drag the units to  different positions in the Units in your schedule field.</p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/iplschedule4.jpg"></p>
                                       <p>Click Orderipl. In the Organize your IPLs area, you can click the up and down arrows in the Tools column to rearrange the order of lessons within a unit.</p>
                                       <p><img alt="" src="../../images/class/IPL01.png" style="width: 500px;"></p>
                                       <p>Clear the check box in the Tools column to remove a lesson from the schedule.</p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/iplschedule6.jpg"></p>
                                       <p>Type a new value in the field in the Grade column to change the grade percentage value.</p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/iplschedule7.jpg"></p>
                                       <p>Clear the check box in the Grade column to exclude the lesson from a student's grade.</p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/iplschedule8.jpg"><br>
                                          <br>
                                          Math Connections (formerly CGAs) are automatically scheduled beneath the last lesson in the unit. You can exclude the Math Connection from the grade book by deselecting the check box next to the grade value. Deselect the check box next to the arrows to remove the Math Connection from the schedule. <br>
